import React, { useState } from "react";

export function ExportImportComponent() {
  return (
    <div class="container">
      <h2>Управление данными</h2>
      <div class="button-group">
        <button class="btnExport">Экспортировать</button>
        <button class="btnImport">Импортировать</button>
      </div>
    </div>
  );
}
